import React from 'react';

function Archive(props: any) {
  return (
    <>
      <div className={`card-box`}>
        <div
          className={`add-section h-top bg-grey-2 text-skyblue cursor-pointer`}
        >
          <div className="icon-box">
            <i className="fas fa-archive"></i>
          </div>
          <div>Archive</div>
        </div>
        <div className="card-body flex-center flex-column"></div>
      </div>
    </>
  );
}
export default Archive;
